{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPDMJkSc7oPGY4BLpzoOoDP"},"kernelspec":{"name":"ir","display_name":"R"},"language_info":{"name":"R"}},"cells":[{"cell_type":"markdown","source":["# **Global Life Expectancy: A Predictive Analysis**\n","\n","## 1. Overview:\n","This project aims to analyze global health and socioeconomic indicators from the Life\n","Expectancy dataset (WHO), obtained from Kaggle\n","(https://www.kaggle.com/datasets/kumarajarshi/life-expectancy-who), to identify the\n","factors that most strongly predict Life Expectancy. Life expectancy is one of the most\n","widely used measures of a population’s overall health, and understanding which health,\n","behavioral, and economic factors contribute to it is essential for policymaking and global\n","health planning. The goal is to determine which factors are significantly associated with\n","longer or shorter life expectancy.\n"],"metadata":{"id":"Ejf5vFQNrs_N"}},{"cell_type":"markdown","source":["## 2. Data Processing:\n","\n","#### 2.1. Importing the Dataset"],"metadata":{"id":"eYgddE3hsM3r"}},{"cell_type":"code","execution_count":37,"metadata":{"id":"vDNDed3Tp6no","colab":{"base_uri":"https://localhost:8080/"},"executionInfo":{"status":"ok","timestamp":1767659898786,"user_tz":300,"elapsed":116,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}},"outputId":"48b0e1b6-62e3-48d6-fe4e-f008c9f40bb0"},"outputs":[{"output_type":"stream","name":"stdout","text":["'data.frame':\t2938 obs. of  22 variables:\n"," $ Country                        : chr  \"Afghanistan\" \"Afghanistan\" \"Afghanistan\" \"Afghanistan\" ...\n"," $ Year                           : int  2015 2014 2013 2012 2011 2010 2009 2008 2007 2006 ...\n"," $ Status                         : chr  \"Developing\" \"Developing\" \"Developing\" \"Developing\" ...\n"," $ Life.expectancy                : num  65 59.9 59.9 59.5 59.2 58.8 58.6 58.1 57.5 57.3 ...\n"," $ Adult.Mortality   