ll_type":"markdown","source":["#### 2.3. Data Cleaning\n","\n","Rows containing any missing values were removed using na.omit(). This reduced the dataset from 2,938 observations to 1,649 complete cases.\n","\n","The variable Country was removed because it is a non-numeric identifier and cannot be used directly as a predictor.\n","The variable Status was retained as a categorical predictor, and Year was included to account for temporal trends in life expectancy."],"metadata":{"id":"BypuR2PD39j7"}},{"cell_type":"code","source":["# To remove the 'Country' column\n","dataset <- subset(dataset, select = -c(Country))\n","\n","# To remove the null values\n","data_clean <- na.omit(dataset)\n","dim(data_clean)"],"metadata":{"id":"U8R0HyeC314B","colab":{"base_uri":"https://localhost:8080/","height":34},"executionInfo":{"status":"ok","timestamp":1767659898835,"user_tz":300,"elapsed":46,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}},"outputId":"051574d6-290b-43f4-acab-97ae01f080bb"},"execution_count":39,"outputs":[{"output_type":"display_data","data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>1649</li><li>21</li></ol>\n"],"text/markdown":"1. 1649\n2. 21\n\n\n","text/latex":"\\begin{enumerate*}\n\\item 1649\n\\item 21\n\\end{enumerate*}\n","text/plain":["[1] 1649   21"]},"metadata":{}}]},{"cell_type":"markdown","source":["## 3. Correlation Analysis:\n","A correlation matrix was computed to examine the relationship between life expectancy and each numeric predictor."],"metadata":{"id":"MOB22iQbwasY"}},{"cell_type":"code","source":["# Calculates correlation and displays it\n","num_vars <- data_clean[sapply(data_clean, is.numeric)]\n","cor_results <- round(cor(num_vars)[\"Life.expectancy\", ], 2)\n","cor_df <- data.frame(Variable = names(cor_results), Correlation = as.numeric(cor_results))\n","\n","kable(cor_df, col.names = c(\"Predictor Variable\", \"Correlation with Life Expectancy\"),\n","      caption = \"Table 1: Correlation Analysis Results\")"],"metadata":{"id":"R8Zjn7n6w055","colab":{"base_uri":"https://localhost:8080/","height":459},"executionInfo":{"status":"ok","timestamp":1767659898912,"user_tz":300,"elapsed":70,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}},"outputId":"b2af56cb-24b0-4bdd-e188-32e94129a9f0"},"execution_count":40,"outputs":[{"output_type":"display_data","data":{"text/plain":["\n","\n","Table: Table 1: Correlation Analysis Results\n","\n","|Predictor Variable              | Correlation with Life Expectancy|\n","|:-------------------------------|--------------------------------:|\n","|Year                            |                             0.05|\n","|Life.expectancy                 |                             1.00|\n","|Adult.Mortality                 |                            -0.70|\n","|infant.deaths                   |                            -0.17|\n","|Alcohol                         |                             0.40|\n","|percentage.expenditure          |                             0.41|\n","|Hepatitis.B                     |                             0.20|\n","|Measles                         |                            -0.07|\n","|BMI                             |                             0.54|\n","|under.five.deaths               |                            -0.19|\n","|Polio                           |                             0.33|\n","|Total.expenditure               |                             0.17|\n","|Diphtheria                      |                             0.34|\n","|HIV.AIDS                        |                            -0.59|\n","|GDP                             |                             0.44|\n","|Population                      |                            -0.02|\n","|thinness..1.19.years            |                            -0.46|\n","|thinness.5.9.years              |                            -0.46|\n","|Income.composition.of.resources |                             0.72|\n","|Schooling                       |                             0.73|"]},"metadata":{}}]},{"cell_type":"markdown","source":["A correlation analysis reveals that Schooling (r=0.73) and Income composition of resources (r=0.72) have the strongest positive relationships with life expectancy. Conversely, Adult Mortality (r=-0.70) and HIV/AIDS (r=-0.59) show the strongest negative correlations. Other notable predictors include positive associations with BMI and GDP, while factors like thinness indicators contribute to lower life expectancy outcomes."],"metadata":{"id":"IRIMdHfX4iQn"}},{"cell_type":"markdown","source":["## 4. Multicollinearity Assessment\n","\n","To detect multicollinearity, correlations among predictors were examined. Predictor pairs with correlations greater than 0.80 were flagged as multicollinear."],"metadata":{"id":"il0wmGHl4uox"}},{"cell_type":"code","source":["# Find variables that are multicollinear\n","cor_mat <- cor(num_vars)\n","cor_mat[lower.tri(cor_mat, TRUE)] <- NA\n","cor_table <- as.data.frame(as.table(cor_mat))\n","cor_table <- na.omit(cor_table)\n","subset(cor_table, abs(Freq) > 0.8)"],"metadata":{"id":"JcVH7bY04g2I","colab":{"base_uri":"https://localhost:8080/","height":190},"executionInfo":{"status":"ok","timestamp":1767659898954,"user_tz":300,"elapsed":41,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}},"outputId":"2eff99c9-9ddc-4849-be61-2d0828b2b31e"},"execution_count":41,"outputs":[{"output_type":"display_data","data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 3 × 3</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Var1</th><th scope=col>Var2</th><th scope=col>Freq</th></tr>\n","\t<tr><th></th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","