\nAIBKEOwAAABUgmAHAACgEgQ7AAAAlSDYAQAAqATBDgAAQCUIdgAAACpBsAMAAFAJgh0AAIBK\nEOwAAABUgmAHAACgEgQ7AAAAlSDYAQAAqATBDgAAQCUIdgAAACpBsAMAAFAJgh0AAIBK/A8P\ncmAFYRz+zQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":["In this QQ plot of the residuals, the points follow the reference line closely, indicating that the residuals are approximately normally distributed. Therefore, the normality assumption is met."],"metadata":{"id":"XViAbzV_cMZP"}},{"cell_type":"markdown","source":["## 8. Random Forest Regression\n","To evaluate whether non-linear relationships improve predictive performance, a Random Forest regression model was trained and compared to the linear regression model."],"metadata":{"id":"iJfmHyt-cYlN"}},{"cell_type":"code","source":["# Set seed for reproducibility and split data (80% training, 20% testing)\n","set.seed(123)\n","n <- nrow(data_final)\n","train_size <- floor(0.80 * n)\n","train_indices <- sample(seq_len(n), size = train_size)\n","\n","train_data <- data_final[train_indices, ]\n","test_data  <- data_final[-train_indices, ]\n","\n","if(!require(randomForest)) {\n","  install.packages(\"randomForest\", repos = \"http://cran.us.r-project.org\")\n","}\n","library(randomForest)\n","\n","# Train the Random Forest model with 500 trees\n","set.seed(123)\n","rf_model <- randomForest(\n","  Life.expectancy ~ .,\n","  data = train_data,\n","  ntree = 500,\n","  importance = TRUE\n",")\n","\n","rf_model"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":170},"id":"Mu4XkrN9cHM-","executionInfo":{"status":"ok","timestamp":1767660621376,"user_tz":300,"elapsed":4606,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}},"outputId":"622b5934-0b73-4585-8f71-76f7d162c018"},"execution_count":57,"outputs":[{"output_type":"display_data","data":{"text/plain":["\n","Call:\n"," randomForest(formula = Life.expectancy ~ ., data = train_data,      ntree = 500, importance = TRUE) \n","               Type of random forest: regression\n","                     Number of trees: 500\n","No. of variables tried at each split: 5\n","\n","          Mean of squared residuals: 3.221999\n","                    % Var explained: 95.86"]},"metadata":{}}]},{"cell_type":"code","source":["# Calculating R^2 ans RMSE values to compare with the linear model\n","rf_test_preds <- predict(rf_model, test_data)\n","\n","rf_test_rmse <- sqrt(mean((test_data$Life.expectancy - rf_test_preds)^2))\n","\n","rss <- sum((test_data$Life.expectancy - rf_test_preds)^2)\n","tss <- sum((test_data$Life.expectancy - mean(test_data$Life.expectancy))^2)\n","rf_test_r2 <- 1 - (rss/tss)\n","\n","print(paste(\"Random Forest Test R2:\", round(rf_test_r2, 4)))\n","print(paste(\"Random Forest Test RMSE:\", round(rf_test_rmse, 3)))"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"9Wj-J8BDgEgu","executionInfo":{"status":"ok","timestamp":1767660688473,"user_tz":300,"elapsed":59,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}},"outputId":"d3871670-51df-44b3-e0ce-a7c9f6062503"},"execution_count":59,"outputs":[{"output_type":"stream","name":"stdout","text":["[1] \"Random Forest Test R2: 0.944\"\n","[1] \"Random Forest Test RMSE: 2.058\"\n"]}]},{"cell_type":"markdown","source":["The significant increase in R^2 (from 0.83 to 0.94) suggests that the Random Forest model successfully captured non-linear relationships in the socioeconomic data"],"metadata":{"id":"K5Ogi0Myofmb"}},{"cell_type":"markdown","source":["### 9. Conclusion\n","\n","#### Model Comparison:\n","Used two different methods to predict life expectancy:\n","* **Linear Regression:** This was my starting point. it worked well and explained about 83% of the data. It showed that there is a strong, direct link between wealth, education, and how long people live.\n","* **Random Forest Regressor:** This is the superior model, achieving a Test R^2\n","of 0.94 and reducing error (RMSE) by nearly 43% compared to the linear model (from 3.64 to 2.06). This performance gap strongly suggests that key predictors, particularly economic factors, influence health outcomes in non-linear ways.\n","\n","#### Insights:\n","* **Education over Expenditure:** Schooling and Resource Composition consistently outranked raw healthcare expenditure as predictors. This implies that policy focused on educational infrastructure may yield higher long-term health returns.\n","* **Disease:** HIV/AIDS and Adult Mortality remain the dominant drags on life expectancy, quantifying the massive impact of disease control on national longevity statistics.\n"],"metadata":{"id":"D9Mzkcwgg10y"}},{"cell_type":"code","source":[],"metadata":{"id":"p8aGmV4Nu9aH","executionInfo":{"status":"ok","timestamp":1767659904521,"user_tz":300,"elapsed":10,"user":{"displayName":"Israt Jahan","userId":"15444365023516674041"}}},"execution_count":52,"outputs":[]}]}